////        String b = "43184489||{\"generalSummarys2\":[\"★ 一般检查:\\n   体重指数:27.40\\n   \\n\\n\",\"★ 肝胆脾胰肾超声:\\n   肝:脂肪肝（轻度）\\n   左肾:左肾结晶\\n   右肾:右肾内钙化灶\\n   \\n\\n\",\"★ 前列腺超声:\\n   前列腺:前列腺钙化灶\\n\\n\",\"★ 血清总胆红素 增高:  (结果:25.5 范围：5.1-19.0 μmol/L)\\n\",\"★ 血清尿素氮(偏低):  (结果:3.08 范围：3.6-9.5 mmol/L)\"],\"generalSummarys\":[{\"result\":\"27.40\",\"fw\":\"18.5-23.9\",\"reviewAdvice\":\"\",\"summaryName\":\"体重指数偏高\",\"summaryAdvice\":\"体重控制方案可使用4种疗法：饮食和营养咨询，行为治疗，药物和外科手术，正规医院专科治疗。\",\"summaryReasonResult\":\"BMI是世界公认的一种评定肥胖程度的分级方法，世界卫生组织(WHO)也以BMI来对肥胖或超重进行定义。体重指数增高，冠心病和脑卒中发病率也会随之上升，超重和肥胖是冠心病和脑卒中发病的独立危险因素。体重指数每增加2，冠心病、脑卒中、缺血性脑卒中的相对危险分别增加15.4%、6.1%和18.8%。 一旦体重指数达到或超过24时，患高血压、糖尿病、冠心病和血脂异常等严重危害健康的疾病的概率会显著增加。\",\"summaryDescription\":\"\",\"summaryMedicalExplanation\":\"医学解释：BMI指数（即身体质量指数，简称体质指数又称体重指数，英文为Body Mass Index，简称BMI），是用体重公斤数除以身高米数平方得出的数字，是目前国际上常用的衡量人体胖瘦程度以及是否健康的一个标准。主要用于统计用途，当我们需要比较及分析一个人的体重对于不同高度的人所带来的健康影响时，BMI值是一个中立而可靠的指标。体重指数24-27.9为超重；大于或等于28为肥胖。\"},{\"result\":\"\",\"fw\":\"\",\"reviewAdvice\":\"\",\"summaryName\":\"肾结晶\",\"summaryAdvice\":\"建议多饮水,避免同时进食富含草酸的食物,如菠菜、苹果、番茄、土豆、甜菜、龙须菜、红茶、可可、巧克力和含钙高的食物如牛奶,奶酪等；定期复查，若有不适，请到专科治疗。\",\"summaryReasonResult\":\"无\",\"summaryDescription\":\"\",\"summaryMedicalExplanation\":\"肾结晶多为草酸钙或尿酸结晶，是结石形成的早期表现。\"},{\"result\":\"\",\"fw\":\"\",\"reviewAdvice\":\"\",\"summaryName\":\"肾内钙化灶\",\"summaryAdvice\":\"可定期复查肾脏超声和肾功能检查。必要时专科诊治。\",\"summaryReasonResult\":\"无\",\"summaryDescription\":\"\",\"summaryMedicalExplanation\":\"往往是肾脏病变痊愈后所遗留，一般无症状。\"},{\"result\":\"\",\"fw\":\"\",\"reviewAdvice\":\"\",\"summaryName\":\"脂肪肝（轻度）\",\"summaryAdvice\":\"建议改变饮食生活习惯，戒酒、减少油腻性食物，坚持适量运动，请定期复查，关注变化。\",\"summaryReasonResult\":\"脂肪肝的发生与肥胖、糖尿病、高脂血症、长期嗜酒、脂肪摄入过多和药物等有关。\",\"summaryDescription\":\"\",\"summaryMedicalExplanation\":\"轻度脂肪肝大多数无任何症状，常在体检中发现。\"},{\"result\":\"\",\"fw\":\"\",\"reviewAdvice\":\"\",\"summaryName\":\"前列腺钙化灶\",\"summaryAdvice\":\"如果合并前列腺增大出现排尿不畅等相关症状,可专科诊治。同时注意避免劳累过度，忌食辛辣食物，忌酒忌烟，多饮水，避免久坐不动，定期复查。\",\"summaryReasonResult\":\"无\",\"summaryDescription\":\"\",\"summaryMedicalExplanation\":\"是前列腺发生炎症愈后所遗留，也可是前列腺结石的前兆，无症状者不必治疗。\"},{\"result\":\"25.5\",\"fw\":\"5.1-19.0 μmol/L \",\"reviewAdvice\":\"\",\"summaryName\":\"血清总胆红素 增高\",\"summaryAdvice\":\"血清胆红素升高主要看总胆红素是否升高，如果总胆红素升高建议尽早去医院，查明升高原因。\",\"summaryReasonResult\":\"血清总胆红素增高一般多是异常情况，升高见于①总胆红素、结合胆红素和未结合胆红素都增高，常见于肝细胞性黄疸，如急性黄疸型肝炎、重症肝炎、慢性活动性肝炎、中毒性肝炎等。  \\n②总胆红素和结合胆红素增高，见于阻塞性黄疸，如胆结石、胆道梗阻、肝癌、胰头癌等。\\n③总胆红素和未结合胆红素升高，常见于溶血性黄疸如血型不合的输血、溶血性贫血、恶性疟疾等。\",\"summaryDescription\":\"\",\"summaryMedicalExplanation\":\"血清胆红素(bilirubin)分为直接胆红素（又称结合胆红素）和间接胆红素（又称未结合胆红素），二者之和为总胆红素（TB）。当体内胆红素生成过多或肝脏摄取、结合、转运能力下降，或胆红素从胆道排泌障碍时，均可引起血中胆红素的升高，临床表现为黄疸。\\n\"}],\"checkItems\":[{\"departmentName\":\"\",\"checkResults\":[{\"canExplain\":0,\"resultValue\":\"137\",\"unit\":\"mmHg\",\"checkIndexName\":\"收缩压\",\"lowValueRef\":\"\",\"highValueRef\":\"\",\"resultFlagId\":1,\"textRef\":\"\",\"appendInfo\":\"\"},{\"canExplain\":0,\"resultValue\":\"78\",\"unit\":\"mmHg\",\"checkIndexName\":\"舒张压\",\"lowValueRef\":\"\",\"highValueRef\":\"\",\"resultFlagId\":1,\"textRef\":\"\",\"appendInfo\":\"\"},{\"canExplain\":1,\"resultValue\":\"171\",\"unit\":\"Cm\",\"checkIndexName\":\"身高\",\"lowValueRef\":\"\",\"highValueRef\":\"\",\"resultFlagId\":1,\"textRef\":\"\",\"appendInfo\":\"\"},{\"canExplain\":1,\"resultValue\":\"80\",\"unit\":\"kg\",\"checkIndexName\":\"体重\",\"lowValueRef\":\"\",\"highValueRef\":\"\",\"resultFlagId\":1,\"textRef\":\"\",\"appendInfo\":\"\"},{\"canExplain\":0,\"resultValue\":\"27.40\",\"unit\":\"\",\"checkIndexName\":\"体重指数(18.5-23.9)\",\"lowValueRef\":\"\",\"highValueRef\":\"\",\"resultFlagId\":1,\"textRef\":\"\",\"appendInfo\":\"\"},{\"canExplain\":0,\"resultValue\":\"体重指数:27.40\\n血压:137/78mmHg\",\"unit\":\"\",\"checkIndexName\":\"小结\",\"lowValueRef\":\"\",\"highValueRef\":\"\",\"resultFlagId\":1,\"textRef\":\"\",\"appendInfo\":\"\"}],\"checkUserName\":\"云婷婷 审核者:程家坦\",\"checkItemName\":\"一般检查\"},{\"departmentName\":\"\",\"checkResults\":[{\"canExplain\":0,\"resultValue\":\"80\",\"